sourcesContent:
import styled from "styled-components";

export const AppBarHeader = styled.header`
  position: sticky;
  background: #c3c3c3;
  width: 100%;
  height: 70px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 10px;
`;

export const AppBarLogoContainer = styled.div`
  width: 45px;
  height: 45px;

  img {
    width: 100%;
  }
`;
